import React from "react";
import "./styles.css";
import Container from "../Container";
import Jumbotron from "../Jumbotron";

function HelloFlashGrid() {
    return (
        <Container>
            <div className="row">
                <div className="col-sm-3">

                </div>

                <div className="col-sm-6">
                    <Jumbotron></Jumbotron>
                </div>

                <div className="col-sm-3">

                </div>


            </div>
        </Container>
    );
}

export default HelloFlashGrid;
